def max_product(words)
  keys = {}

  words.each do |word|
    key = word.chars.uniq.sort.join
    unless keys.has_key?(key)
      keys[key] = word.length
    else
      keys[key] = word.length if word.length > keys[key]
    end
  end

  infos = []
  words = []

  idx = 0

  keys.each_pair do |key, length|
    infos << [key.chars, key.length]
    words << [length, idx]
    idx += 1
  end
  
  words = words.sort do |w1, w2|
    w2[0] <=> w1[0]
  end
  
  ret = 0

  0.upto(words.length - 1) do |idx1|
    l1 = words[idx1][0]
    k1 = infos[words[idx1][1]][0]
    k1l = infos[words[idx1][1]][1]

    break if l1 ** 2 <= ret

    (idx1 + 1).upto(words.length-1).each do |idx2|
      l2 = words[idx2][0]
      k2 = infos[words[idx2][1]][0]
      k2l = infos[words[idx2][1]][1]
      if k1l + k2l <= 26
        break if ret != 0 && l2 * l1 <= ret

        if (k1 & k2).empty?
          ret = l1 * l2 if l1 * l2 > ret
          break
        end
      end
    end
  end
  ret
end
